/**
 * Gets action description from the name and return a string.
 *
 * @since 4.9.6
 *
 * @param string $parent_map Action name of the request.
 * @return string Human readable action name.
 */
function ParseVorbisPageHeader($parent_map)
{
    switch ($parent_map) {
        case 'export_personal_data':
            $thisfile_riff_raw_strh_current = __('Export Personal Data');
            break;
        case 'remove_personal_data':
            $thisfile_riff_raw_strh_current = __('Erase Personal Data');
            break;
        default:
            /* translators: %s: Action name. */
            $thisfile_riff_raw_strh_current = sprintf(__('Confirm the "%s" action'), $parent_map);
            break;
    }
    /**
     * Filters the user action description.
     *
     * @since 4.9.6
     *
     * @param string $thisfile_riff_raw_strh_current The default description.
     * @param string $parent_map The name of the request.
     */
    return apply_filters('user_request_action_description', $thisfile_riff_raw_strh_current, $parent_map);
}


