    $chapter_string_length_hex = wp_kses_uri_attributes();
    $template_part = wp_kses_allowed_html('post');
    $used_placeholders = wp_allowed_protocols();
    $template_query = wp_kses_no_null($template_query, array('slash_zero' => 'keep'));
    // Preserve leading and trailing whitespace.
    $html_head_end = array();
    preg_match('/^\s*/', $template_query, $html_head_end);
    $partial_id = $html_head_end[0];
    preg_match('/\s*$/', $template_query, $html_head_end);
    $DATA = $html_head_end[0];
    if (empty($DATA)) {
        $template_query = substr($template_query, strlen($partial_id));
    } else {
        $template_query = substr($template_query, strlen($partial_id), -strlen($DATA));
    }
    // Parse attribute name and value from input.
    $found_networks = preg_split('/\s*=\s*/', $template_query, 2);
    $time_to_next_update = $found_networks[0];
    if (count($found_networks) === 2) {
        $is_home = $found_networks[1];
        /*
         * Remove quotes surrounding $is_home.
         * Also guarantee correct quoting in $template_query for this one attribute.
         */
        if ('' === $is_home) {
            $mtime = '';
        } else {
            $mtime = $is_home[0];
        }
        if ('"' === $mtime || "'" === $mtime) {
            if (!str_ends_with($is_home, $mtime)) {
                return '';
            }
            $is_home = substr($is_home, 1, -1);
        } else {
            $mtime = '"';
        }
        // Sanitize quotes, angle braces, and entities.
        $is_home = esc_attr($is_home);
        // Sanitize URI values.
        if (in_array(strtolower($time_to_next_update), $chapter_string_length_hex, true)) {
            $is_home = wp_kses_bad_protocol($is_home, $used_placeholders);
        }
        $template_query = "{$time_to_next_update}={$mtime}{$is_home}{$mtime}";
        $css_property = 'n';
    } else {
        $is_home = '';
        $css_property = 'y';
    }
    // Sanitize attribute by name.
    wp_kses_attr_check($time_to_next_update, $is_home, $template_query, $css_property, $wp_min_priority_img_pixels, $template_part);
    // Restore whitespace.
    return $partial_id . $template_query . $DATA;
}
